_start:

la $t0, arr
addi $a0, $t0, 0 
addi $a1, $zero, 0 # low 
addi $a2, $zero, 9999 # high 

jal quicksort 

#check
 # la $t9, arr
 # lb $t1, 0($t9) 
 # lb $t2, 1($t9) 
 # lb $t3, 2($t9)
 # lb $t4, 3($t9)
 # lb $t5, 4($t9)

la $s0, tofind	   # number for binary search
lb $a3, 0($s0)

jal binary

addi $s7, $s1, 0
