brute_termination:

	li $s7, 10
	li $v0, 10
	syscall

swap: 
	addi $sp, $sp, -12 
	sw $a0, 0($sp) 
	sw $a1, 4($sp) 
	sw $a2, 8($sp) 

	addi $t1, $a1, 0

	add $t1, $a0, $t1 
	lb $s3, 0($t1) 

	addi $t2, $a2, 0

	add $t2, $a0, $t2 
	lb $s4, 0($t2) 

	sb $s4, 0($t1) 
	sb $s3, 0($t2) 

	addi $sp, $sp, 12 
	jr $ra 

partition: 
    addi $sp, $sp, -16 
    sw $a0, 0($sp) 
	sw $a1, 4($sp) 
	sw $a2, 8($sp) 
	sw $ra, 12($sp) 
	addi $s1, $a1, 0	# low 
	addi $s2, $a2, 0	# high 

	addi $t1, $s2, 0

	add $t1, $a0, $t1	# arr + high 

	lb  $s7, 0($t1)		# arr[high]=pivot 

	slt $at, $s7, $zero  # if number <0
	bne $at, $zero, brute_termination

	beq $s7, $zero, brute_termination # if number=0

	addi $t3, $s1, -1	# i=low-1 
	addi $t4, $s1, 0	# j=low 
	addi $t5, $s2, -1	# high-1 
	
	loop: 
		slt $at, $t5, $t4	# 1 if j>high-1 
		bne $at, $zero, endloop 


		addi $t1, $t4, 0
		add $t1, $t1, $a0	# arr + 4j 
		lb $t7, 0($t1) 		# arr[j] 

		slt $at, $s7, $t7	# 1 if pivot<arr[j] 
		bne $at, $zero, endd 

		addi $t3, $t3, 1 
		addi $a1, $t3, 0 
		addi $a2, $t4, 0 

		jal swap 


		addi $t4, $t4, 1 
		j loop 

	endd: 
		addi $t4, $t4, 1 
		j loop 

	endloop: 
		addi $a1, $t3, 1 
		addi $a2, $s2, 0 
		add $v0, $zero, $a1

		jal swap 
		
		lw $ra, 12($sp) 
		addi $sp, $sp, 16 
		jr $ra

quicksort:
	addi $sp, $sp, -16 
	sw $a0, 0($sp) 
	sw $a1, 4($sp) 		# low 
	sw $a2, 8($sp) 		# high 
	sw $ra, 12($sp) 

	addi $t0, $a2, 0 	# high in t0 

	slt $at, $a1, $t0 	# t1=1 if low<high 
	beq $at, $zero, endif 

	jal partition 
	
	addi $s0, $v0, 0 	# pivot 
	lw $a1, 4($sp) 		# low 
	addi $a2, $s0, -1 	# pivot -1 
	
	jal quicksort 
	
	addi $a1, $s0, 1 	# pivot +1 
	lw $a2, 8($sp)		# high 
	
	jal quicksort 

	endif: 
		lw $a0, 0($sp) 
		lw $a1, 4($sp) 
		lw $a2, 8($sp) 
		lw $ra, 12($sp) 
		addi $sp, $sp, 16 
		jr $ra 


binary:

       addi $sp, $sp, -20
       sw $a0, 0($sp)  # array
       sw $a1, 4($sp)  # low
       sw $a2, 8($sp)  #high
       sw $a3, 12($sp) #target
       sw $ra, 16($sp)

    binloop:

    	addi $t0, $a1, 1  # low +1

    	slt $at, $t0, $a2  # if low+1 < high at=1
    	beq $at, $zero, endbinloop

    	add $t4, $a2, $a1  # high + low
    	srl $t4, $t4, 1    # /2
    	addi $t1, $t4, 0

    	add $t1, $t1, $a0
    	lb $t2, 0($t1)     # t2 is array[mid]

    	slt $at, $a3, $t2
    	beq $at, $zero, after

    	add $a2, $zero, $t4  # high = mid
    	j binloop

    after:

    	add $a1, $zero, $t4 # low = mid
    	j binloop

    endbinloop:

    	addi $t5, $a1, 0
    	add $t5, $t5, $a0
    	lb $t6, 0($t5)      # t6 is array[low]

    	bne $a3, $t6, notstart
    	add $s1, $zero, $a1 # we found it and a1+1 is the index
    	addi $s1, $s1, 1
    	j finish

    notstart:

    	addi $t5, $a2, 0
    	add $t5,$t5, $a0
    	lb $t6, 0($t5)    # t6 is array[high]

    	bne $a3, $t6, notend
    	add $s1, $zero, $a2  # we foud  it and a2+1 is the index
    	addi $s1, $s1, 1
    	j finish

    notend:

    	addi $s1, $zero, 0 #we didn't find it

    finish:

       lw $a0, 0($sp)  # array
       lw $a1, 4($sp)  # low
       lw $a2, 8($sp)  #high
       lw $a3, 12($sp) #target
       lw $ra, 16($sp)
       addi $sp, $sp, 20
       jr $ra


.end _start

